import React from "react";
import MuiButton from "@mui/material/Button";

const Button = ({
  type = "button",
  variant = "contained",
  onClick,
  children,
  bgColor = "bg-blueCustom",
  width = "auto",
}) => {
  return (
    <div className={`${bgColor} ${width}`}>
      <MuiButton
        type={type}
        variant={variant}
        onClick={onClick}
        className="hover:opacity-80 transition"
      >
        {children}
      </MuiButton>
    </div>
  );
};

export default Button;




